import "./styles.css";

import Expenses from "./components/Expenses";

function App() {
  const expenses = [
    {
      title: "toilet paper",
      amount: 94.12,
      date: new Date(2022, 7, 14)
    },
    {
      title: "car insurance",
      amount: 100.12,
      date: new Date(2021, 9, 12)
    },
    {
      title: "new chair",
      amount: 200.12,
      date: new Date(2020, 9, 24)
    }
  ];

  return <Expenses items={expenses} />;
}
export default App;
